import React, { Component } from 'react';

class NotFound extends Component {
	render() {
		return (


			<div className="error-wrapper container">
				<div className="row">
					<div className="col-md-4 col-md-offset-4 col-sm-6 col-sm-offset-3 col-xs-offset-1 col-xs-10">
						<div className="error-container">
							<div className="error-main">
								<div className="error-number"> 500 </div>
								<div className="error-description"> We seem to have lost you in the clouds. </div>
								<div className="error-description-mini"> The page your looking for is not here </div>
								<br/>
								<div className="row">
									<div className="input-with-icon col-md-12"> <i className="fa fa-search"></i>
										<input type="text" className="form-control" id="form1Name" name="form1Name"/>
									</div>
								</div>
								<br/>
								<button className="btn btn-primary btn-cons" type="button">Search</button>
							</div>
						</div>
					</div>
				</div>


			</div>

		);
	}
}

export default NotFound;
